import "../components/semantic-ui/components/grid.css";

import React, { useState } from "react";

export default function LoginFailed() {
    const backTo = () => {
        localStorage.clear();
        window.location.replace("login");
    }

    const [hitung, setHitung] = useState(0);

    if (hitung < 50000) {
        for (let i = 0; i < 50000; i++) {
            setHitung(i);
        }
    }
    else {
        backTo();
    }

    return(
        <body>
            <div onClick={backTo} className="ui middle aligned center aligned grid" style={{ height: "100vh"}}>
                <div onClick={backTo} className="column" style={{ maxWidth: 450 }}>
                    <h1 onClick={backTo}>Anda bukan karyawan Tinknet!!!</h1>
                </div>
            </div>
        </body>
    )
}
